import React from 'react'

import './css/SignUpContent.scss'

const SignUpContent = (props) => {
    return (
        <>
            <div id='signup-CONTAINER'>
                <div id='signup-BACKGROUND'></div>
                <div id='signup-FORM'></div>
            </div>
        </>
    )
}

export default SignUpContent
